le=\"padding-top: 30px\">\n<table style=\"width: 100%;border-collapse: collapse;color: #666\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"padding: 20px 30px\">Full Name:</td>\n<td style=\"padding: 20px 30px;color: #5191fa;border-color: #000\">[st_info_full_name]</td>\n</tr>\n<tr>\n<td style=\"padding: 20px 30px\">Username:</td>\n<td style=\"padding: 20px 30px;color: #5191fa\">[st_info_user_name]</td>\n</tr>\n<tr>\n<td style=\"padding: 20px 30px\">Email:</td>\n<td style=\"padding: 20px 30px\">[st_info_user_email]</td>\n</tr>\n<tr>\n<td style=\"padding: 20px 30px\">Register Date:</td>\n<td style=\"padding: 20px 30px\">[st_info_user_date_create]</td>\n</tr>\n<tr>\n<td style=\"padding: 28px 30px\">Services Registration:</td>\n<td style=\"padding: 20px 30px\">[st_info_user_certificates]</td>\n</tr>\n</tbody>\n</table>\n</td>\n</tr>\n<tr>\n<td style=\"padding-bottom: 20px;font-size: 20px;padding-top: 50px;text-align: center\"><a style=\"background-color: #666;border-radius: 5px;color: #fff;font-family: tahoma;font-size: 14px;font-weight: bold;margin-left: 10px;padding: 10px 30px;text-decoration: none\" href=\"[st_url_info_user]\" target=\"_blank\" rel=\"noopener\">CHECK NOW&nbsp;</a><a style=\"background-color: #5192fa;border-radius: 5px;color: #fff;font-family: tahoma;font-size: 14px;font-weight: bold;margin-left: 10px;padding: 10px 30px;text-decoration: none\" href=\"[st_url_list_user_partner]\" target=\"_blank\" rel=\"noopener\">VIEW ALL REQUEST</a></td>\n</tr>\n</tbody>\n</table>\n<table style=\"color: #818181;width: 1000px;font-family: Poppins, sans-serif !important\" width=\"100%\" cellspacing=\"0\" align=\"center\">\n<tbody>\n<tr style=\"background: #F5F5F5\">\n<td style=\"width: 60%;padding: 25px\"><span style=\"margin-bottom: 13px;display: inline-block;line-height: 23px;font-size: 15px\">Booking, reviews and advices on hotels, resorts, flights,<br />vacation rentals, travel packages, and lots more!</span><br /><a style=\"color: #333;text-decoration: none\" href=\"#\">About Us</a><span style=\"font-size: 15px\">&nbsp;&nbsp;|&nbsp;&nbsp;</span><a style=\"color: #333;text-decoration: none\" href=\"#\">Contact Us</a><span style=\"font-size: 15px\">&nbsp;&nbsp;|&nbsp;&nbsp;</span><a style=\"color: #333;text-decoration: none\" href=\"#\">News</a></td>\n<td style=\"width: 60%;padding: 25px;text-align: right\"><a style=\"margin: 10px;display: inline-block\" href=\"http://traveler.local\"><img class=\"alignnone wp-image-6292\" src=\"http://traveler.local/wp-content/themes/traveler/img/email/social/social-f.png\" alt=\"eb_face\" width=\"35\" height=\"35\" /></a>&nbsp;<a style=\"margin: 10px;display: inline-block\" href=\"http://traveler.local\"><img class=\"alignnone wp-image-6296\" src=\"http://traveler.local/wp-content/themes/traveler/img/email/social/social-t.png\" alt=\"\" width=\"35\" height=\"35\" /></a>&nbsp;<a style=\"margin: 10px;display: inline-block\" href=\"http://traveler.local\"><img class=\"alignnone wp-image-6295\" src=\"http://traveler.local/wp-content/themes/traveler/img/email/social/social-ins.png\" alt=\"\" width=\"35\" height=\"35\" /></a></td>\n</tr>\n</tbody>\n</table>'),
